platforms:		.word		17, 52, 10, 20, 36, 23, 0, 55, 40, 39, 0, 17, 2, 35, 37, 54, 50, 54
movement:		.word		10
health:			.word 		10

.text
.globl main

main:	
    jal draw_start            # Call draw_start to display the start page


initialize:
    jal Background            # Call Background function to draw the background
    jal draw_header
    jal fire
    jal draw_collect
    jal draw_apple
    jal draw_apple2
    li $a3, FIRSTPOS          # Load the initial position of the character
    li $s6, ENEMY1POS
    li $s7, ENEMY2POS
    li $s4, ENEMY3POS
    jal drawCharacter         # Call drawCharacter function to draw the character
    jal enemy1
    jal enemy2
    jal enemy3
    
    j loop
	
loop:

    jal check_health
    jal draw_header
    
    li $a1, 0xffff0000
    lw $t8, 0($a1)
    andi $t8, $t8, 0x0001
    	
    
    bne $t8, 1, c
   	
    jal keypress

c:	
    jal check_grav
    jal clear_platforms
    jal update_platforms
    jal draw_platforms
  

sleep:	
 
    li $v0, 32
    li $a0, 50
    syscall
    
    j loop


keypress:
	
	li	$t1, SHIFT_NEXT_ROW
	li	$t2, BASE_ADDRESS
	addi	$t2, $t2, SHIFT_NEXT_ROW
	li	$t3, DISPLAY_LAST_ADDRESS
	
	lw	$t0, 4($a1)
	beq	$t0, 0x61, key_a						# ASCII code of 'a': 0x61
	beq	$t0, 0x77, key_w						# ASCII code of 'w': 0x77
	beq	$t0, 0x64, key_d						# ASCII code of 'd': 0x64
	beq	$t0, 0x72, key_r						# ASCII code of 'r': 0x72
	beq	$t0, 0x63, key_c
	
	j loop
	
	# go left
	key_a:
	
	
		div	$a3, $t1
		mfhi	$t9						
		beq	$t9, $zero, keypress_done
		
		move $t5, $a3
		addi $t5, $t5, 2048
		lw $t5, 0($t5)
		beq $t5, DARKNEON, decreasehealth1
		beq $t5, TURQOUISE, draw_won
		
		move $t5, $a3
		addi $t5, $t5, 1532
		lw $t5, 0($t5)
		beq $t5, TURQOUISE, draw_won
		
		move $t5, $a3
		addi $t5, $t5, 2304
		lw $t5, 0($t5)
		beq $t5, TURQOUISE, draw_won
		beq $t5, BEIGE, increase_health2
		beq $t5, DARKNEON, decreasehealth1
		
		move $t5, $a3
		addi $t5, $t5, 2048
		lw $t5, 0($t5)
		beq $t5, DARKNEON, decreasehealth1
		bne $t5, BACKGROUND, keypress_done
		
		
		move $t5, $a3
		addi $t5, $t5, 1788
		lw $t5, 0($t5)
		beq $t5, MIDBLUE, decreasehealth2
		beq $t5, DARKORANGE, decreasehealth3
		beq $t5, DARKNEON, decreasehealth1
		bne $t5, BACKGROUND, keypress_done
		
		move $t5, $a3
		addi $t5, $t5, 2304
		lw $t5, 0($t5)
		beq $t5, DARKNEON, decreasehealth1
		bne $t5, BACKGROUND, keypress_done
		
		jal clear_character
		jal move_left				

		b keypress_done
	# go up
	key_w:
		
		blt	$a3, $t2, keypress_done
		
		move $t5, $a3
		addi $t5, $t5, 512
		lw $t5, 0($t5)
		beq $t5, DARKORANGE, decreasehealth3
		
		jal clear_character
		jal move_up

					
		b keypress_done

	# go right
	key_d:
		
		
		div	$a3, $t1						
		mfhi	$t9							
		
		addi	$t1, $t1, -40
		beq	$t9, $t1, keypress_done	
		
		move $t5, $a3
		addi $t5, $t5, 2340
		lw $t6, 0($t5)
		beq $t6, NEON, keypress_done
		
		move $t5, $a3
		addi $t5, $t5, 2084
		lw $t6, 0($t5)
		beq $t6, DARKNEON, decreasehealth1
		
		move $t5, $a3
		addi $t5, $t5, 2080
		lw $t6, 0($t5)
		beq $t6, GREEN, increase_health
		
		move $t5, $a3
		addi $t5, $t5, 2340
		lw $t6, 0($t5)
		beq $t6, GREEN, increase_health
								
		
		jal clear_character
		jal move_right
		b keypress_done
	
	key_r:
		# restart game
		la	$ra, main
		jr $ra
	
	
	key_c:
		
		jal shoot
		
		b keypress_done
	
	keypress_done:
		j loop							# jump to ra
		
	
move_right: 
	add $a3, $a3,4

	addi $sp, $sp, -4
	sw $ra, 0($sp)
	
	
	#jal draw_platforms
	#jal enemy1
	jal drawCharacter
	
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	jr $ra

move_left: 
	add $a3, $a3, -4

	li $t0, BASE_ADDRESS
	
	addi $sp, $sp, -4
	sw $ra, 0($sp)	
	
	
	#jal draw_platforms
	#jal enemy1
	jal drawCharacter
	
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	jr $ra		

	
											
move_up: 
    li $t0, BASE_ADDRESS
    
    addi $sp, $sp, -4
    sw $ra, 0($sp)

    # Set up loop counter
    li $t1, 9

move_up_loop:
    addi $a3, $a3, -256
    move $t4, $a3
    move $t5, $a3
    addi $t4, $t4, 16
    lw $t4, 0($t4)
    addi $t5, $t5, 12
    lw $t5, 0($t5)
    
    bne $t5, BACKGROUND, check_grav
    bne $t4, BACKGROUND, check_grav
    
    addi $t1, $t1, -1
    bgtz $t1, move_up_loop

    jal drawCharacter
    #jal enemy1
    #jal draw_platforms

    lw $ra, 0($sp)
    addi $sp, $sp, 4
    jr $ra
	
call_check_grav:
	li $s5, 0
	j check_grav		
	
Background:
    li $t0, BASE_ADDRESS
    li $t1, BACKGROUND
    addi $t7,$t0,16384
    addi $t8,$t0,15360
    
fill_sky:
   beq $t0,$t7, b_exit
   sw $t1,0($t0)
   add $t0,$t0,4
   j fill_sky
   
b_exit:
	jr $ra

shoot:
    addi $sp, $sp, -12        # Allocate space for $ra, $t4, and $t5
    sw $ra, 8($sp)            # Save the return address on the stack
    li $t5, BACKGROUND        # Initialize $t5 with the background color

    move $t1, $a3
    addi $t1, $t1, -SHIFT_NEXT_ROW
    addi $t1, $t1, 16
    li $t2, ORANGE
    li $t0, WHITE
    li $t3, BACKGROUND

bullet_loop:
    lw $t4, 0($t1)            # Save the color of the current position
    beq $t4, WHITE, exit_loop # If the current position is white, exit the loop
    beq $t4, MIDBLUE, exit_enem2
    beq $t4, LIGHTBLUE, exit_enem2
    beq $t4, DARKORANGE, exit_enem3
    beq $t4, LIGHTORANGE, exit_enem3

    sw $t2, 0($t1)            # Draw the bullet at the current position
    addi $t1, $t1, 256
    
    li $v0, 32
    li $a0, 10
    syscall
    
    sw $t5, 0($t1)            # Restore the previous color at the new position
    addi $t1, $t1, -512
    move $t5, $t4             # Save the color of the next position for the next iteration

    j bullet_loop

exit_loop:
    lw $ra, 8($sp)            # Restore the return address from the stack
    addi $sp, $sp, 12         # Deallocate stack space
    jr $ra
 
exit_enem2:
    jal clear_enemy2
    lw $ra, 8($sp)            # Restore the return address from the stack
    addi $sp, $sp, 12         # Deallocate stack space
    jr $ra	

exit_enem3:
    jal clear_enemy3
    lw $ra, 8($sp)            # Restore the return address from the stack
    addi $sp, $sp, 12         # Deallocate stack space
    jr $ra	
    
gravity:
	addi	$sp, $sp, -4
	sw	$ra, 0($sp)
	
	jal clear_character
	add $a3, $a3, 256
	jal drawCharacter
	
	li $v0, 32
	li $a0, 5
	syscall
	
	
	lw $ra, 0($sp)
	addi $sp, $sp, 4
	
	jr  $ra 
	
check_grav:
    addi $sp, $sp, -4
    sw $ra,0($sp)

    addi $t0,$a3, 3084 # stores the pixel of the feet
    lw $t6, 0($t0) # gets the colour value
    addi $t1, $a3, -SHIFT_NEXT_ROW
    addi $t1, $t1, 16
    
    lw $t7, 0($t1)
    
    addi $t3, $a3, 3096 # stores the pixel of the feet
    lw $t3, 0($t3) # gets the colour value
    
    addi $t4, $a3, 2560 # stores the pixel of the body
    lw $t4, 0($t4) # gets the colour value
    
    addi $t5, $a3, 2304 # stores the pixel of the body
