draw_start: 

	    li $t0, BASE_ADDRESS        # $t0 stores base address
            la $t1, start_page        # $t1 stores address of game_over
            li $t2, 0            # $t2 stores counter
            li $t3, NUM_UNITS        # $t3 stores total units

loop_start: 
	    bge $t2, $t3, exit_start
            sll $t4, $t2, 2            # calculate offset
            add $t5, $t1, $t4        # $t5 stores address of color for current unit
            lw $t5, 0($t5)            # $t5 stores color of current unit
            add $t4, $t4, $t0        # $t4 stores address of current unit
            sw $t5, 0($t4)            # paint unit black
            addi $t2, $t2, 1        # increment counter
            j loop_start

exit_start:
	jal wait_for_enter         # Call wait_for_enter function to wait for the Enter key press

    # Clear the screen
    li $t0, BASE_ADDRESS        # $t0 stores base address
    li $t1, 0x000000            # $t1 stores the color black (0x000000)
    li $t2, 0                   # $t2 stores counter
    li $t3, NUM_UNITS           # $t3 stores total units	


wait_for_enter:
    li $t0, 0xffff0000         # Load the keyboard status register address into $t0
    li $t1, 0xffff0004         # Load the keyboard data register address into $t1

wait_key_loop:
    lw $t2, 0($t0)             # Load the value at the keyboard status register into $t2
    beqz $t2, wait_key_loop    # If the value is zero, wait for a key press

    lw $t3, 0($t1)             # Load the value at the keyboard data register into $t3
    li $t4, 0x61
    li $t5, 0x64               # Load the ASCII value for Enter key into $t4
    li $t6, 0x0A
    
    beq $t3, $t4, yes__
    beq $t3, $t5, no__
    bne $t3, $t6, wait_key_loop 	# If the value is not equal to Enter key, wait for a key press
    #beq $t3, $t6, option
    	
	
no__:	
    jal draw_no           # Call draw_start to display the start page
    li $t7, 0
    li $t7, 1
    li $v0, 32
    li $a0, 500
    syscall
    #jal wait_key_loop        # Call wait_for_enter function to wait for the Enter key press
    j draw_gg

yes__:
    jal draw_yes
    li $t7, 1
    li $v0, 32
    li $a0, 500
     syscall
    #jal wait_key_loop
    j initialize

    
draw_yes:
	li $t0, BASE_ADDRESS        # $t0 stores base address
            la $t1, yes        # $t1 stores address of game_over
            li $t2, 0            # $t2 stores counter
            li $t3, NUM_UNITS        # $t3 stores total units
            j loop_yes
            jr $ra
		
draw_no:
	li $t0, BASE_ADDRESS        # $t0 stores base address
            la $t1, no        # $t1 stores address of game_over
            li $t2, 0            # $t2 stores counter
            li $t3, NUM_UNITS        # $t3 stores total units
            j loop_yes
            jr $ra
       

draw_gg:
	    li $t0, BASE_ADDRESS        # $t0 stores base address
            la $t1, gg        # $t1 stores address of game_over
            li $t2, 0            # $t2 stores counter
            li $t3, NUM_UNITS        # $t3 stores total units
            jal loop_gg

draw_won:
	    li $t0, BASE_ADDRESS        # $t0 stores base address
            la $t1, won        # $t1 stores address of game_over
            li $t2, 0            # $t2 stores counter
            li $t3, NUM_UNITS        # $t3 stores total units
            jal loop_gg

loop_yes: 
	    bge $t2, $t3, exit_yes
            sll $t4, $t2, 2            # calculate offset
            add $t5, $t1, $t4        # $t5 stores address of color for current unit
            lw $t5, 0($t5)            # $t5 stores color of current unit
            add $t4, $t4, $t0        # $t4 stores address of current unit
            sw $t5, 0($t4)            # paint unit black
            addi $t2, $t2, 1        # increment counter
            j loop_yes
            


exit_yes:
	jr $ra

loop_gg: 
	    bge $t2, $t3, exit
            sll $t4, $t2, 2            # calculate offset
            add $t5, $t1, $t4        # $t5 stores address of color for current unit
            lw $t5, 0($t5)            # $t5 stores color of current unit
            add $t4, $t4, $t0        # $t4 stores address of current unit
            sw $t5, 0($t4)            # paint unit black
            addi $t2, $t2, 1        # increment counter
            j loop_gg           
	
	
#############################################################################################################################
draw_platforms:		la $t3, platforms		
			
			li $t8, NUM_PLATFORMS		
			add $t9, $zero, $zero		
			
draw_platforms_loop:	bge $t9, $t8, draw_platforms_end 
			
			add $s0, $zero, $zero		
			add $s1, $zero, $zero		
			
			li $s2, PLATFORM_WIDTH
			li $s3, PLATFORM_HEIGHT
			
draw_nested_loop:	bge $s1, $s3, exit_nested_loop
			bge $s0, $s2, reset_x
			j draw_platform
			
reset_x:		add $s0, $zero, $zero		
			addi $s1, $s1, 1		
			j draw_nested_loop
			
draw_platform:		li $t0, BASE_ADDRESS		
			lw $t1, 0($t3)			
			lw $t2, 4($t3)			
			add $t1, $s0, $t1		
			add $t2, $t2, $s1		
			
			sll $t1, $t1, 2			
			sll $t2, $t2, 8			
			add $t0, $t0, $t1		
			add $t0, $t0, $t2		

			li $s7, DARKBROWN

			sw $s7, 0($t0)			
			addi $s0, $s0, 1		
			j draw_nested_loop
			
exit_nested_loop:	addi $t9, $t9, 1		
			addi $t3, $t3, 8		
			j draw_platforms_loop
				
draw_platforms_end:	jr $ra



	
clear_platforms:	la $t3, platforms		
			
			li $t8, 2			
			add $t9, $zero, $zero		
			
clear_platforms_loop:	bge $t9, $t8, clear_platforms_end 
			
			add $s0, $zero, $zero		
			add $s1, $zero, $zero		
			
			li $s2, PLATFORM_WIDTH
			li $s3, PLATFORM_HEIGHT
			
clear_nested_loop:	bge $s1, $s3, exit_nested_loop_c
			bge $s0, $s2, reset_x_c
			j clear_platform
			
reset_x_c:		add $s0, $zero, $zero		
			addi $s1, $s1, 1		
			j clear_nested_loop
			
clear_platform:		li $t0, BASE_ADDRESS		
			lw $t1, 0($t3)			
			lw $t2, 4($t3)			
			add $t1, $s0, $t1		
			add $t2, $t2, $s1		
			
			sll $t1, $t1, 2			
			sll $t2, $t2, 8			
			add $t0, $t0, $t1		
			add $t0, $t0, $t2		
			li $s7, BACKGROUND

			sw $s7, 0($t0)			
			addi $s0, $s0, 1		
			j clear_nested_loop
			
exit_nested_loop_c:	addi $t9, $t9, 1		
			addi $t3, $t3, 8		
			j clear_platforms_loop
				
clear_platforms_end:	jr $ra			



update_platforms:	addi $sp, $sp, -4
			sw $ra, 0($sp)
			
			la $t0, movement
			lw $t1, 0($t0)
			
			bgtz $t1, go_right
			j go_left
		
go_right:		la $t2, platforms
			lw $t3, 0($t2)
			lw $t4, 8($t2)
			
			addi $t3, $t3, 1
			addi $t4, $t4, 1
			
			sw $t3, 0($t2)
			sw $t4, 8($t2)
			

			addi $t1, $t1, -1
			
			beqz $t1, change_left
			sw $t1, 0($t0)
			j update_platforms_end
			
change_left:		addi $t1, $zero, -12
			sw $t1, 0($t0)	
			j update_platforms_end		

go_left:		la $t2, platforms
			lw $t3, 0($t2)
			lw $t4, 8($t2)
			
			addi $t3, $t3, -1
			addi $t4, $t4, -1
			
			sw $t3, 0($t2)
			sw $t4, 8($t2)
			
			addi $t1, $t1, 1
			
			beqz $t1, change_right
			sw $t1, 0($t0)
			j update_platforms_end
			
change_right:		addi $t1, $zero, 12
			sw $t1, 0($t0)	
			j update_platforms_end														
			
update_platforms_end:	lw $ra, 0($sp)
			addi $sp, $sp, 4

			jr $ra


