			lw $t9, 0($t9)
			addi $t8, $zero, 0		
			
health_loop:		beq $t8, $t9, health_exit	
			li $t0, BASE_ADDRESS		
			addi $t1, $zero, 5
			addi $t2, $zero, 1
			add $t1, $t1, $t8
			
			sll $t1, $t1, 2			
			sll $t2, $t2, 8			
			add $t0, $t0, $t1		
			add $t0, $t0, $t2		
			
			li $t7, LIGHTRED		
			
			sw $t7, 0($t0)			
			
			addi $t8, $t8, 1		
			j health_loop
			
